import React from 'react'
import { makeStyles } from "@material-ui/core";
import Typography from '@mui/material/Typography';
import { Link } from 'react-router-dom';
import { NavItem, NavMenu } from '@mui-treasury/components/menu/navigation';

const useStyles = makeStyles(() => ({
  navbar: {
    backgroundColor: "#14161a",
    color: "#fff",
    minHeight: "auto",
    justifyContent: "space-between",
    alignItems: "center",
  },
}));

const IdeaPage = () => {
  const classes = useStyles();
  return (
  <div >
    <NavMenu className={classes.navbar} gutter={'8px'}>
      <NavItem as={Link} to={'/components/menu/'}>
        Products
      </NavItem>
      <NavItem>Services</NavItem>
      <NavItem>Blog</NavItem>
      <NavItem active>Help</NavItem>
      <NavItem>Contact Us</NavItem>
    </NavMenu>
    <Typography align='center' mt={8} variant="h1" component="h2">
      Idea Development
    </Typography>;
  </div>
  );

}

export default IdeaPage
